import React from 'react';
import './App.css';

class App extends React.Component {
  state = {
    gitHubUsers: []
  };

  componentDidMount() {
    fetch("https://api.github.com/users/")
  }
  render(){
    return (
      <div></div>
    )
  }
}

export default App;
